/*Table structure for table `wms_orderproduct` */

DROP TABLE IF EXISTS `wms_orderproduct`;

CREATE TABLE `wms_orderproduct` (
  `orderproducrtid` varchar(255) NOT NULL COMMENT '主键',
  `innerpackagenum` varchar(255) DEFAULT NULL COMMENT '包裹单号',
  `customerordernum` varchar(255) DEFAULT NULL COMMENT '客户订单号',
  `outerordernum` varchar(255) DEFAULT NULL COMMENT '外部订单号',
  `outerproductnum` varchar(255) DEFAULT NULL COMMENT '外部货号',
  `barcode` varchar(255) DEFAULT NULL COMMENT '商品条码',
  `count` varchar(255) DEFAULT NULL COMMENT '数量',
  `declarePrice` varchar(255) DEFAULT NULL COMMENT '平台实际零售价',
  `retailPrice` varchar(255) DEFAULT NULL COMMENT '平台结算价格',
  `remark` varchar(255) DEFAULT NULL COMMENT '备注',
  `createuser` varchar(255) DEFAULT NULL,
  `createtime` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `updateuser` varchar(255) DEFAULT NULL,
  `updatetime` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  PRIMARY KEY (`orderproducrtid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

